def heap_qsort(nums): 
    fin_size =len(nums)
    if fin_size == 0: 
        return nums
    else: 
        pivot = (len(nums) // 2) - 1
        i =  0
        while(i < fin_size): 
            if(nums[i] <= nums[pivot]): 
                i += 1
            else: 
                nums[pivot] = nums[i]
                pivot += 1
            i += 1
        nums[pivot] = nums[fin_size - 1]
